import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './assets/index.css';
import 'bootstrap/dist/css/bootstrap.css';
import Provider from 'react-redux';
ReactDOM.render(
  <Provider>
  <App />
  </Provider>,
document.getElementById('root')
);
